Here's a Python function to find the longest common subsequence (LCS) of two input strings using dynamic programming:

```python
def longest_common_subsequence(X, Y):
    # Create a 2D array to store the lengths of common subsequences
    L = [[0] * (1 + len(Y)) for _ in range(1 + len(X))]

    # Fill the 2D array in a bottom-up manner
    for x in range(1, 1 + len(X)):
        for y in range(1, 1 + len(Y)):
            if X[x - 1] == Y[y - 1]:
                L[x][y] = L[x - 1][y - 1] + 1
            else:
                L[x][y] = max(L[x - 1][y], L[x][y - 1])

    # Read the LCS from the 2D array
    result = []
    x, y = len(X), len(Y)
    while x > 0 and y > 0:
        if X[x - 1] == Y[y - 1]:
            result.append(X[x - 1])
            x -= 1
            y -= 1
        elif L[x - 1][y] > L[x][y - 1]:
            x -= 1
        else:
            y -= 1

    # Return the LCS in the correct order
    return ''.join(reversed(result))


# Test the function
