```

This function uses dynamic programming to build a 2D array `L` where `L[i][j]` represents the length of the longest common subsequence of the first `i` characters of `X` and the first `j` characters of `Y`. It then reads the LCS from the 2D array in a top-down manner and returns the result as a string. The time complexity is O(m*n), where `m` and `n` are the lengths of the input strings.

